tables.table_schema:
CREATE TABLE rentals (
    rental_id SERIAL PRIMARY KEY,
    customer_id INT,
    rental_date DATE,
    return_date DATE
);

CREATE TABLE bicycles (
    bike_id SERIAL PRIMARY KEY,
    model VARCHAR(100),
    type VARCHAR(50),
    rental_price DECIMAL(10, 2)
);

CREATE TABLE bicycles (
    bicycle_id INT PRIMARY KEY,
    model VARCHAR(50),
    type VARCHAR(50),
    price_per_hour DECIMAL(8, 2)
);
